 Kandi Cox, Tina Cheri, Sana Fey, Chantz Fortune, Summer Cummings, Marc Davis, Dillon Day, Pat Myne

 With a keen eye for what's hot and what's not, noted porn star Skye Blue shines just as bright behind the camera as she did during her day in front of the lens. Told in an Arabian Nights format by sultry Summer Cummings, five ancient period tales tell of a lowly dungeon dweller rescued by a lovely lass, a prince searching for his lost princess, a king's reward to his personal baker, a village maiden's encounter with a giant, and a wish for returned love from a magic pool.
